import React from 'react';

import TaskTodayItem from '../TaskTodayItem/TaskTodayItem';
import './TaskTodayList.css';

const TaskTodayList = props => {
  return (
    <ul className="taskItem-list">
      {props.items.map(taskItem => (
        <TaskTodayItem
          key={taskItem.id}
          id={taskItem.id}
          onDelete={props.onDeleteItem}
        >
          {taskItem.text}
        </TaskTodayItem>
      ))}
    </ul>
  );
};

export default TaskTodayList;
